import React from "react";
export const NotFound = () => {
  return (
    <div className="p-20 bg-404 bg-cover h-screen bg-blend-lighten">
      {/* <h1 className="text-9xl font-bodyFont font-extrabold text-transparent shadow-2xl drop-shadow-2xl w-fit backdrop-blur-md bg-clip-text"> */}
      <div className="flex gap-10 items-center">
        <div className="flex flex-col">
          <h1 className="text-9xl font-bodyFont z-20 font-extrabold text-white shadow-2xl">
            404
          </h1>
          <h1 className="text-9xl font-bodyFont z-20 font-extrabold text-white shadow-2xl">
            Error
          </h1>
        </div>
        <span className="text-[12rem] font-bodyFont z-20 font-extrabold text-white shadow-2xl">
          :
        </span>
        <div className="text-8xl text-white font-extrabold shadow-2xl">
          Fashion Emergency
        </div>
      </div>
    </div>
  );
};
